var tipuesearch = {"pages": [{'title': 'About', 'text': '標題: 2021-協同產品設計實習-stage2-ag5 \n stage2-ag5 repo \xa0 \xa0 \xa0  stage2-ag5 site \n 專題題目: 排球扣球練習器 \n 第一位組員學號:40823102劉怡萱\xa0\xa0 repo \xa0\xa0 site \n 第二位組員學號:40823106廖苡雯\xa0\xa0 repo \xa0\xa0 site \n 第三位組員學號:40823135林澤叡\xa0\xa0 repo \xa0\xa0 site \n 第四位組員學號:40823121粘晁偉\xa0\xa0 repo \xa0\xa0 site \n', 'tags': '', 'url': 'About.html'}, {'title': 'W5', 'text': '討論專題方向 \n 我們這次的專案，決定以上一次未完成的排球扣球練習器進行改良；原本的主體只有單一的骨架與球軌，我們將改良成雙向作動與作動時間長的機構，讓排球可以順利滑動；並改良夾持的機構，改良成讓球在圓盤滾動一段時間後，球體的中心滑動到圓盤的中心點後自動掉落。 \n Stage1-18做動 \n \n 預定每週進度 \n W5 討論專題方向、每週進度 \n W6 繪製零件圖、在coppeliasim進行模擬並修正錯誤 \n W7  在coppeliasim進行模擬並修正錯誤、進行Heroku協統 \n W8 修正零件圖、在coppeliasim進行模擬並修正錯誤、準備pdf、製作reavel並分配上台報告內容 \n W9 上台報告 \n', 'tags': '', 'url': 'W5.html'}, {'title': 'W6', 'text': '預定進度: 繪製零件圖 \n 骨架、球軌、接住球的部分 \n \n 轉盤及支撐軸，透過轉盤週期作旋轉動作讓球也成週期落下 \n \n \n 發球器的軸、底座、擊球的轉臂 \n \n 發球器組合圖 \n \n 發球器做動 \n \n 整體組合圖 \n \n 嘗試使用coppeliasim模擬發球器進行做動 \n \n', 'tags': '', 'url': 'W6.html'}, {'title': 'W7', 'text': '預定進度:在coppeliasim進行模擬並修正錯誤、進行Heroku協統 \n', 'tags': '', 'url': 'W7.html'}, {'title': 'W7 coppeliasim模擬', 'text': '在coppeliasim進行模擬 \n \n 模擬後發現圓盤尺寸有誤且在模擬上很難達到圓盤週期與發球器時間一致，除把圓盤直徑加大外也討論如何修正圖。 \n', 'tags': '', 'url': 'W7 coppeliasim模擬.html'}, {'title': 'Heroku協同', 'text': '1. 建立 Heroku 帳號，並且登記後要進入 @gm 帳號進行確認後才能開通 Heroku 帳號. \n \n 2. 建立 Heroku app \n 3. 下載 Heroku CLI \n \n 4. 修改命令搜尋路徑 \n \n 5. 以 git 進行提交推送 \n 先在小黑窗登入 \n heroku login  - i \n 再推送資料 \n heroku git:remote  - a\xa0 \n', 'tags': '', 'url': 'Heroku協同.html'}, {'title': 'W8', 'text': '預定進度:修正零件圖、在coppeliasim進行模擬並修正錯誤、準備pdf、製作reavel並分配上台報告內容 \n', 'tags': '', 'url': 'W8.html'}, {'title': '繪圖更改', 'text': 'W7 coppeliasim進行模擬後發現轉盤太小會造成球一樣滾動因此將圓盤直徑加大 \n \n 模擬後發現須將底座挖圓盤軸的洞，不然組合圖放入coppeliasim時會自動視為一體，會導致無法驅動 \n \n', 'tags': '', 'url': '繪圖更改.html'}, {'title': 'W8 coppeliasim模擬', 'text': '在coppeliasim進行模擬 \n \n 目前模擬做動還無法讓兩邊的圓盤都呈周期做動，只能兩個發球器旋轉跟一個圓盤轉動。 \n \n \n 模擬時發現軸沒有設定好導致圓盤碰到球軌就會停下無法繼續轉動 \n', 'tags': '', 'url': 'W8 coppeliasim模擬.html'}, {'title': 'W9', 'text': '2021-協同產品設計實習-stage2-ag5報告書', 'tags': '', 'url': 'W9.html'}]};